import React from "react";
import FreeShippingBar from "../Components/FreeShippingBar/FreeShippingBar";
import OffersBar from "../Components/OffersBar/OffersBar";
import GoogleNews from "../assests/Pixel_8_Pro.jpg";
import HuaewiNews from "../assests/desk.webp";
import LGNews from "../assests/MMSA_TSR_mob_new.jpg";
import MetaNews from "../assests/MMSA_TSR_mob_new.jpg";
const HomePage = () => {
  return (
    <>
      <FreeShippingBar />
      <OffersBar image={GoogleNews} />
      <OffersBar image={HuaewiNews} />
      <OffersBar image={LGNews} />
      <OffersBar image={MetaNews} />
    </>
  );
};

export default HomePage;
